import Moment from 'react-moment';
import moment from 'moment';

export default function Dashboard(){
    const start = moment().add(-4, 'm');
    return(
        <div id="render-item">
            this is dashboard
          
            <Moment date={start} format="hh:mm:ss" durationFromNow />
        </div>
    )
}
